import React from 'react'
import Netflex from './Netflex'
import Amazon from './Amazon'

const favSeries = 'amazon'

function App() {
  return (
    <>
      <h1>Hello This is Shyam</h1>

      {favSeries === 'amazon' ? <Amazon /> : <Netflex />}
    </>
  )
}

export default App
